INSERT INTO `hizmet` (`id`, `baslik`, `spot`, `icerik`, `gorsel`, `icon`, `tags`, `meta_desc`, `sira`, `anasayfa`, `durum`, `dil`) VALUES
(1, 'Google Reklam Danışmanlığı', 'Google’a ait olan Adwords, ilgili kullanıcıları web sitenize çekmek için tercih edilen önemli platformlardan biridir.', '<p>Google&rsquo;a ait olan Adwords, ilgili kullanıcıları web sitenize &ccedil;ekmek i&ccedil;in tercih edilen &ouml;nemli platformlardan biridir. Adwords, Google&rsquo;da her g&uuml;n yapılan milyonlarca aramadan yararlanmanıza olanak sağlarken aynı zamanda marka veya işletmeniz i&ccedil;in &ccedil;eşitli kampanya ve reklamlar oluşturarak, sizi Google&rsquo;da alakalı arama sonu&ccedil;larında &uuml;st sıralarda g&ouml;sterir.</p>\r\n<p><strong>Google Adwords Nasıl &Ccedil;alışır?</strong><br />Google &uuml;zerinde bir arama yaptığınızda o kelime ile ilgili binlerce site sıralanarak &ouml;n&uuml;m&uuml;ze gelir. Fakat binlerce site arasından ilk sayfada listelemeye girmek kolay değildir. Bu durumda, Adwords reklamları rol oynar.</p>\r\n<p>Google Adwords ile sizin siteniz aramalarda &uuml;st sıralara taşınır. Adwords reklamları ile marka veya işletmenizi bir&ccedil;ok potansiyel m&uuml;şterinin g&ouml;rmesi sağlanır. Bunun yanında Adwords, reklamlarınızın ne zaman ve nerede g&ouml;r&uuml;neceğini se&ccedil;menize de imkan verir.</p>\r\n<p>&Uuml;r&uuml;n&uuml;n&uuml;zle ilgili yalnızca arama sonu&ccedil;larında değil, &uuml;r&uuml;n&uuml;n&uuml;zle ilgi siteleri hedefleyip, s&ouml;z konusu sitelerde de reklamlarınızın g&ouml;sterilmesini Adwords sayesinde sağlayabilirsiniz. Bununla birlikte yine Adwords ile ulusal haber siteleri ile emlak haber sitelerini hedefleyebilirsiniz. Adwords, marka veya işletmenize internet &uuml;zerinden yeni m&uuml;şteriler edinmeniz i&ccedil;in geliştirilmiştir.</p>\r\n<p>&Uuml;r&uuml;n ya da hizmetinize ihtiyacı olan kullanıcılar arama yaptığında onları satın almaya hazır oldukları an hedefleyen reklamlar oluşturmanızda Adwords size yardımcı olur. Firmanız i&ccedil;in online m&uuml;şteriler &uuml;r&uuml;n&uuml;n&uuml;z ile ilgili arama yaptıkları sırada &ccedil;ıkan reklamınızı tıklamak ya da tıklamamak arasında se&ccedil;im yaparlar.</p>', '6054140073247-285-74-747652_creation-of-ads-google-adwords-premier-smb-partner.png', 'fa-share-alt', 'hizmetler,viva,kurumsal,hizmet etiket', '1', 1, '1', '1', 'tr'),
(2, 'Twitter Reklamları', 'Curabitur turpis. Proin viverra, ligula sit amet ultrices semper, ligula arcu tristique sapien, a accumsan nisi mauris ac eros.', '<p>Twitter kullanıcılarının sayısı her ge&ccedil;en g&uuml;n daha da artıyor. Twitter yakın bir tarihe kadar &uuml;lkemizde &ccedil;ok fazla kullanıcıya ulaşmamış bir sosyal ağ olmasına rağmen son 1,5 yılda olduk&ccedil;a rağbet g&ouml;r&uuml;yor. 20 milyondan fazla T&uuml;rk kullanıcıya sahip platform, reklam alarak markalar i&ccedil;in cazip bir mecra olmuştur.</p>\r\n<p>Twitter kendi i&ccedil;erisinde temelde 3 farklı reklam modeli sunmaktaydı. 2015 yılında hızla b&uuml;y&uuml;me kaydeden platform, kullanıcılara 6 yeni reklam modeli ile daha geniş bir alanda hizmet vermeye başladı. Bu yeni reklam modellerinden bazıları reklam verenler tarafından olduk&ccedil;a sık kullanılmaktadır.</p>\r\n<p>Twitter, reklam vermek isteyen markalar i&ccedil;in birka&ccedil; reklam modeli sunuyor. Markalar bu modeller i&ccedil;erisinden ihtiyacını karşılayabiliyor ve kampanyalarını oluşturabiliyor. Şimdi bu reklam modellerine g&ouml;z atalım:</p>\r\n<p>Tweet etkileşimleri: Takip&ccedil;ilerinizle etkileşim sağlamanız i&ccedil;in Twitter&rsquo;daki g&ouml;nderilerinizi &ouml;ne &ccedil;ıkarmanızı sağlayan reklam modelidir. Tweetlerinizin g&ouml;sterimini yeni kitlelere de yapabilirsiniz</p>\r\n<p>Web sitesi tıklamaları veya d&ouml;n&uuml;ş&uuml;mleri: Bu reklam modelinde kullanıcılarınızı Tweetleriniz ile internet sitenize trafik &ccedil;ekmek, satın alma ve &uuml;yelik gibi eylemler i&ccedil;in y&ouml;nlendirebilirsiniz.</p>\r\n<p>Uygulama y&uuml;klemeleri veya uygulama yeniden etkileşimleri: Mobil uygulamanız var ise bunu kitlenize sunabilir onlara<br />uygulamanızı y&uuml;kletebilirsiniz. Bu reklam modelinde ayrıca daha &ouml;nce kullanan kişilere uygulamanızı yeniden g&ouml;stermeniz m&uuml;mk&uuml;nd&uuml;r.</p>\r\n<p>Video g&ouml;r&uuml;n&uuml;mleri: Twitter&rsquo;a y&uuml;klediğiniz videoların izlenme oranını y&uuml;kseltebilirsiniz.</p>\r\n<p>Takip&ccedil;iler: Twitter&rsquo;daki takip&ccedil;i sayınızı y&uuml;kseltebilirsiniz.</p>\r\n<p>Twitter&rsquo;daki y&ouml;nlendirmeler: Twitter&rsquo;daki tekliflerinizle ilgilenen kişilerden bu yolla e-posta toplamanız m&uuml;mk&uuml;n.</p>', '1011323104612-513-6858319-twitter-wallpaper.jpg', 'fa-share-alt', '', '', 2, '1', '1', 'tr'),
(3, 'Sosyal Medya Danışmanlığı', 'Curabitur turpis. Proin viverra, ligula sit amet ultrices semper, ligula arcu tristique sapien, a accumsan nisi mauris ac eros.', '<p>Sosyal medya platformları şirketlerin, markaların ya da kişilerin kendilerini hedef kitlelerine dilediği gibi anlatabildiği, internet &uuml;zerindeki platformların genel adıdır. Bu tanım g&ouml;z &ouml;n&uuml;ne alındığında sosyal medyanın bu kadar &ccedil;ok kullanılmasındaki nedenler de kolaylıkla anlaşılabilir. Kişiler ya da markalar sosyal medya &uuml;zerinden hedef kitlesine g&ouml;receli olarak bir &uuml;cret &ouml;demeden kolaylıkla ulaşabiliyor. Daha da &ouml;nemlisi insanlarla algısını, tarzını, d&uuml;ş&uuml;ncesini paylaşabiliyor.</p>\r\n<p>Bunun yanında markalar s&ouml;ylemek istediklerini en iyi yansıtacak sosyal medya platformlarını da se&ccedil;me &ouml;zg&uuml;rl&uuml;ğ&uuml; yakalıyorlar. Fotoğraflar &uuml;zerinden tanıtım yapmak isterse Instagram&rsquo;ı, sadece videolarla yansıtmak istediğinde Youtube&rsquo;u, tamamen kurumsal olmak i&ccedil;in Linkedin&rsquo;i ya da eğlence odaklı olmak i&ccedil;in Snapchat&rsquo;i se&ccedil;ebileceği gibi hepsi i&ccedil;inse Facebook&rsquo;u tercih edebiliyor.</p>\r\n<p>Sosyal medya tercih edilebilirlik a&ccedil;ısından televizyon gazete ve film gibi geleneksel medyaya fark atıyor. &Ccedil;&uuml;nk&uuml;;</p>\r\n<p>Bu mecralara g&ouml;re daha fazla erişilebilir olan sosyal medya platformları herkesin kullanımı i&ccedil;in uygundur. Kontrol altında olan geleneksel medyada mesajlar ortaya &ccedil;ıktıktan sonra değiştirilemez ancak sosyal medyada paylaşımlara yorumlara anında m&uuml;dahale etmek m&uuml;mk&uuml;nd&uuml;r. Sosyal medya bu anlamda &ouml;zg&uuml;rd&uuml;r. Tercih edilmesindeki en b&uuml;y&uuml;k nedenlerden biri de sunduğu bu ifade &ouml;zg&uuml;rl&uuml;ğ&uuml;d&uuml;r.</p>', '2457336084917-188-Intro-to-Social-Media.width-1200.png', 'fa-share-alt', '', '', 3, '1', '1', 'tr'),
(4, 'Arama Motoru Optimizasyonu', 'Curabitur turpis. Proin viverra, ligula sit amet ultrices semper, ligula arcu tristique sapien, a accumsan nisi mauris ac eros.', '<p>İngilizce&rsquo;deki &ldquo;Search Engine Optimization&rdquo; kelimelerinin kısaltmasından oluşan SEO, dijital pazarlamanın en &ouml;nemli alanlarından biridir. T&uuml;rk&ccedil;e&rsquo;de &ldquo;Arama Motoru Optimizasyonu&rdquo; olarak ifade edilen SEO, sitenizin, internet &uuml;zerinden arama yapan kullanıcıların aradıkları i&ccedil;eriklere dair en alakalı ve doğru verileri bulmalarını sağlayan arama motorlarının sıralama kriterlerine uygun bir şekilde optimize edilmesi s&uuml;re&ccedil;lerinin tamamıdır. Sitenizin, diğer siteler arasından sıyrılarak kullanıcılara getirilmesi a&ccedil;ısından b&uuml;y&uuml;k &ouml;nem taşıyan SEO işlemi, sitenizi Google ve diğer arama motorlarının sıralama kriterlerine uyumlu hale getirir.</p>\r\n<h2>SEO Nasıl Yapılır?</h2>\r\n<p>SEO &ccedil;alışması yalnızca belirli kelimelerde sıralama y&uuml;kseltmenin &ouml;tesinde bir s&uuml;re&ccedil;tir. SEO&rsquo;nun amacı kullanıcıların yaptıkları sorgulara g&ouml;re en doğru bilgi ve hizmeti verebilmektir. VIVAKurumsal Medya olarak SEO hizmeti verdiğimiz firmalara en yararlı olacak i&ccedil;eriği, arama motorlarının teknik anlamda bu i&ccedil;eriğe daha kolay ulaşabilmesini ve i&ccedil;eriğin kalitesini arttırmak i&ccedil;in bağlantı iyileştirmeleri ger&ccedil;ekleştiriyoruz.</p>\r\n<p>Alanında uzman SEO ekibimiz, eğitimlere katılarak kendini her an daha da geliştirmekte ve SEO&rsquo;daki yenilikleri &ccedil;alışmalarına titizlikle yansıtmaktadır. Kesintisiz ekip koordinasyonumuz sayesinde de bilgilerimiz daima g&uuml;ncel kalmaktadır.</p>', '8806204725988-861-planning_hire_seo_expert.png', 'fa-share-alt', '', '', 4, '1', '1', 'tr');
